import React from 'react'
import { Card } from "react-bootstrap";
import ProductsJson from "../js/data.json";

function Commissions() {
  return (
    <div class="container">
  <div class="row row-cols-2 row-cols-lg-4 g-2 g-lg-3">
    
      {ProductsJson.map((data) => (
         <div class="col">
         <div class="p-2 bg-light">
            <Card  key={data.id}>
            <Card.Img
                variant="top"
                src={data.image}
                style={{ height: "20rem" }}
                className="mainImage"
              />
              <Card.Body className="text-center">
                  <h6
                    style={{
                      fontSize: "1.1rem",
                      fontFamily: "FuturaPT,Arial,sans-serif",
                    }}
                  >
                    {data.title}
                  </h6>
                  <Card.Text
                    style={{
                      fontSize: "0.86rem",
                      fontFamily: "FuturaPT,Arial,sans-serif",
                    }}
                  >
                    {data.price} usd
                  </Card.Text>
                </Card.Body>
            
            </Card>
            </div>
    </div>
        ))}
      
   
  </div>
</div>
  )
}

export default Commissions
